insert  into `categoria`(`id`,`titulo`,`desc`,`orden`,`created_at`,`updated_at`) values (1,'Datos demográficos',NULL,1,NULL,'2018-07-11 03:34:45'),(2,'Bienestar: Inventario integral de la prosperidad (CIT)','<p>Por favor, indique su acuerdo o desacuerdo con cada una de las siguientes afirmaciones.</p>',2,NULL,NULL),(3,'Virtudes y fortalezas: Inventario completo de las instancias virtuosas del carácter (CIVIC)','<p>Por favor, indique hasta d&oacute;nde lo describe cada una de las siguientes afirmaciones.</p>',11,NULL,NULL),(4,'Personalidad: Mini-IPIP','<p style=\"text-align: justify;\">Las siguientes p&aacute;ginas incluyen una serie de frases que describen diferentes comportamientos. Por favor utilice la escala de calificaci&oacute;n a continuaci&oacute;n para indicar con cu&aacute;nta exactitud lo describe cada una de las afirmaciones. Descr&iacute;base a s&iacute; mismo como es ahora, no como desear&iacute;a ser en el futuro. Descr&iacute;base a s&iacute; mismo como usted honestamente se ve, en relaci&oacute;n con otras personas que conoce de su mismo sexo y aproximadamente de su misma edad. Para que pueda usted describirse de forma honesta, su respuesta se mantendr&aacute;n de forma absolutamente confidencial. Por favor, lea cada afirmaci&oacute;n con cuidado.</p>',12,NULL,NULL),(5,'Salud física',NULL,3,NULL,NULL),(6,'Espiritualidad: Escala de experiencias espirituales diarias','<p>La lista a continuaci&oacute;n incluye elementos que usted puede o no experimentar. Por favor, considere con qu&eacute; frecuencia tiene esta experiencia directamente, y trate de ignorar el hecho de si cree que deber&iacute;a o no tener estas experiencias.</p>',4,NULL,NULL),(7,'Estrés: Escala del estrés percibido','<p>Las preguntas en esta escala son acerca de sus sentimientos y pensamientos durante el &uacute;ltimo mes. En cada caso, se le pedir&aacute; que indique <em>con qu&eacute; frecuencia</em> se sinti&oacute; o pens&oacute; de cierta forma.</p>',5,NULL,NULL),(8,'Satisfacciones de dominio: Encuesta MIDUS','<p>Por favor, califique los diferentes aspectos de su vida:</p>',13,NULL,NULL),(9,'Depresión: Escala de depresión PROMIS','<p>En los &uacute;ltimos 7 d&iacute;as&hellip;</p>',6,NULL,NULL),(10,'Ansiedad: Escala de ansiedad PROMIS ','<p>En los &uacute;ltimos 7 d&iacute;as&hellip;</p>',7,NULL,NULL),(11,'Rabia: Escala de rabia PROMIS','<p>En los &uacute;ltimos 7 d&iacute;as&hellip;</p>',8,NULL,NULL),(12,'Concienciarse (Mindfulness): Inventario Freiburg de Concienciarse ','<p>Por favor utilice los &uacute;ltimos 30 d&iacute;as como marco de tiempo para considerar cada elemento. Proporcione la mejor respuesta que pueda para cada afirmaci&oacute;n. Por favor, conteste de forma tan honesta y espont&aacute;nea como le sea posible. No hay respuestas \"correctas\" ni \"incorrectas\", ni respuestas \"buenas\" o \"malas\". Lo que es importante para nosotros es su propia experiencia personal.</p>',9,NULL,NULL),(13,'Endeudamiento / Finanzas','<p>Por favor piense acerca de sus finanzas actuales y eval&uacute;e el grado en el que est&aacute; de acuerdo con las siguientes afirmaciones</p>',10,NULL,NULL),(14,'TFS','<p>Utilice la siguiente escala para indicar qu&eacute; tanto est&aacute; usted de acuerdo o en desacuerdo con cada afirmaci&oacute;n a continuaci&oacute;n:</p>',14,NULL,NULL),(15,'Índice de Esperanza de Herth','<p>A continuaci&oacute;n encontrar&aacute; una lista de afirmaciones. Utilice la siguiente escala para indicar qu&eacute; tanto est&aacute; usted de acuerdo o en desacuerdo con cada afirmaci&oacute;n a continuaci&oacute;n</p>',15,NULL,NULL);

