insert  into `detalle_historic`(`id`,`cambio`,`texto`,`dimencion`,`titulo`) values (3,'verdeamarillo','Felicitaciones!!!  Tu bienestar social mejoró con respecto a tu última medición. Tienes relaciones fuertes y de apoyo. Te sientes cerca de los demás y confías en que tus amigos(as) y/o tus familiares estarán allí cuando los necesites. Sigue invirtiendo en tus relaciones actuales: pasa tiempo con tus seres queridos, hazles saber que aprecias su apoyo y conviertelos en una prioridad en tu vida.','social','Relaciones Sociales'),(4,'amarillorojo','Felicitaciones!!!  Tu bienestar social mejoró con respecto a tu última medición. \r\nTiene buenas relaciones en tu vida, pero tal vez puedas sentirte más conectado(a) y apoyado(a) por otros a veces. Continúa invirtiendo en tus relaciones actuales: pasa tiempo con tus seres queridos, demuestra tu aprecio cuando otros te apoyen y conviértelo en una prioridad en tu vida. También considera desarrollar nuevas amistades.\r\n','social','Relaciones Sociales'),(5,'verderojo','Felicitaciones!!!  Tu bienestar social mejoró muy significativamente con respecto a tu última medición.Tienes relaciones fuertes y de apoyo. Te sientes cerca de los demás y confías en que tus amigos(as) y/o tus familiares estarán allí cuando los necesites. Sigue invirtiendo en tus relaciones actuales: pasa tiempo con tus seres queridos, hazles saber que aprecias su apoyo y conviertelos en una prioridad en tu vida.','social','Relaciones Sociales'),(6,'amarilloverde','Tu bienestar social desmejoró con respecto a tu última medición. Esto significa que la calidad de tus relaciones interpersonales ha sido deteriorada y te sientes menos conectado(a) que antes con las demás personas. Puedes tener algunas buenas relaciones en tu vida, pero tal vez puedas sentirte más conectado(a) y apoyado(a) por otros a veces. \r\n\r\nSin embargo, conocer este cambio es el primer paso para mejorar tu bienestar social, así que no te desanimes! Aprovecha esta oportunidad para explorar tus vínculos con los que te rodean y desarrollar así estrategias concretas para mejorarlos. \r\nInvierte en tus relaciones actuales: pasa tiempo con tus seres queridos, demuestra tu aprecio cuando otros te apoyen y conviértelo en una prioridad en tu vida. También considera desarrollar nuevas amistades. \r\n\r\nEl bienestar social es uno de los factores de mayor impacto para la salud de las personas, así que te reiteramos la importancia de buscar formas de fortalecer tus relaciones interpersonales. \r\n','social','Relaciones Sociales'),(7,'rojoamarillo','Tu bienestar social desmejoró con respecto a tu última medición. Estás luchando con las relaciones en tu vida, sintiéndote un tanto desconectado(a) y sin apoyo de los demás.\r\nSin embargo, conocer este cambio es el primer paso para mejorar tu bienestar social, así que no te desanimes! Aprovecha esta oportunidad para explorar tus vínculos con los que te rodean y desarrollar así estrategias concretas para mejorarlos. \r\nTrabaja para conectarte con otras personas: pasa tiempo con otras personas, demuestra tu aprecio cuando otros te apoyan y haz  la construcción de relaciones positivas una prioridad en tu vida.\r\nEl bienestar social es uno de los factores de mayor impacto para la salud de las personas, así que te reiteramos la importancia de buscar formas de fortalecer tus relaciones interpersonales. \r\n','social','Relaciones Sociales'),(8,'rojoverde','Tu bienestar social desmejoró muy significativamente con respecto a tu última medición. \r\nEstás luchando con las relaciones en tu vida, sintiéndote un tanto desconectado(a) y sin apoyo de los demás.\r\nSin embargo, conocer este cambio es el primer paso para mejorar tu bienestar social, así que no te desanimes! Aprovecha esta oportunidad para explorar tus vínculos con los que te rodean y desarrollar así estrategias concretas para mejorarlos. \r\n\r\nTrabaja para conectarte con otras personas: pasa tiempo con otras personas, demuestra tu aprecio cuando otros te apoyan y haz  la construcción de relaciones positivas una prioridad en su vida.\r\nEl bienestar social es uno de los factores de mayor impacto para la salud de las personas, así que te reiteramos la importancia de buscar formas de fortalecer tus relaciones interpersonales. \r\n','social','Relaciones Sociales'),(9,'verdeverde','Felicitaciones, continuas teniendo un alto nivel de bienestar social! Tienes relaciones fuertes y de apoyo. Te sientes cerca de los demás y confías en que tus amigos(as)  y/o tus familiares estarán allí cuando los necesitas. Sigue invirtiendo en tus relaciones actuales: pasa tiempo con tus seres queridos, hazles saber que aprecias su apoyo y conviertelos en una prioridad en tu vida.','social','Relaciones Sociales'),(10,'amarilloamarillo','Continúas manteniendo un nivel moderado de bienestar social. Tienes buenas relaciones en tu vida, pero tal vez puedas sentirte más conectado(a) y apoyado(a) por otros a veces.\r\n\r\nSi bien conservas un nivel medio de bienestar social te invitamos a aprovechar esta oportunidad para explorar tus vínculos con los que te rodean y desarrollar así estrategias concretas para mejorarlos. \r\n\r\nContinúa invirtiendo en tus relaciones actuales: pasa tiempo con tus seres queridos, demuestra tu aprecio cuando otros te apoyen y conviértelo en una prioridad en tu vida. El bienestar social es uno de los factores de mayor impacto para la salud de las personas, así que te reiteramos la importancia de buscar formas de fortalecer tus relaciones interpersonales. ','social','Relaciones Sociales'),(11,'rojorojo','Desde la última evaluación, tu bienestar social permanece en el extremo inferior. Está luchando con las relaciones en tu vida, sintiéndote un tanto desconectado(a) y sin apoyo de los demás.\r\n\r\nSin embargo, adquirir conciencia de este aspecto es el primer paso para mejorar tu bienestar social, así que no te desanimes! Aprovecha esta oportunidad para explorar tus vínculos con los que te rodean y desarrollar así estrategias concretas para mejorarlos. Trabaja para conectarte con otras personas: pasa tiempo con otras personas, demuestra tu aprecio cuando otros te apoyan y convierte  la construcción de relaciones positivas una prioridad en su vida.\r\n\r\nEl bienestar social es uno de los factores de mayor impacto para la salud de las personas, así que te reiteramos la importancia de buscar formas de fortalecer tus relaciones interpersonales.\r\n','social','Relaciones Sociales'),(12,'amarillorojo','Felicitaciones!!!  Tu bienestar físico mejoró con respecto a tu última medición. Probablemente sientes más energía, y tienes un mejor estado físico. \r\nPor lo general, tienes una buena salud física, aunque es posible que tengas problemas de dolor o de salud que a veces puedan interferir con tus actividades cotidianas en el trabajo o en actividades sociales.\r\nTe invitamos a que continues haciendo actividades que contribuyen a un estado físico óptimo \r\na través del ejercicio regular moderado, alimentación saludable, sueño adecuado y otras actividades que te parezcan útiles.','physical','Salud Fisica'),(13,'verdeamarillo','Felicitaciones!!!  Tu bienestar físico mejoró con respecto a tu última medición. Tienes una excelente salud física y puedes realizar tus actividades cotidianas.\r\nProbablemente sientes más energía, y tienes un mejor estado físico. Te invitamos a que continues haciendo actividades que contribuyen a un estado físico óptimo a través del ejercicio regular moderado, alimentación saludable, sueño adecuado y otras actividades que te parezcan útiles.','physical','Salud Fisica'),(14,'verderojo','Felicitaciones!!!  Tu bienestar físico mejoró muy significativamente con respecto a tu última medición. Tienes una excelente salud física y puedes realizar tus actividades cotidianas. Probablemente sientes más energía, y tienes un mejor estado físico. Te invitamos a que continues haciendo actividades que contribuyen a un estado físico óptimo a través del ejercicio regular moderado, alimentación saludable, sueño adecuado y otras actividades que te parezcan útiles.\r\n','physical','Salud Fisica'),(15,'amarilloverde','Tu bienestar físico desmejoró con respecto a tu última medición. \r\nPor lo general, tienes una buena salud física, aunque es posible que tengas problemas de dolor o de salud que a veces puedan interferir con sus actividades cotidianas en el trabajo o en actividades sociales.\r\nSin embargo, conocer este cambio es el primer paso para mejorar tu bienestar físico, así que no te desanimes! Aprovecha esta oportunidad para explorar tu salud física y recuerda que es esta el cimiento para una buena salud mental. Verifica con tu médico las estrategias para controlar el dolor y apoyar la función diaria podría ser útil. Apoya tu salud física a través del ejercicio regular moderado, la alimentación saludable, el sueño adecuado y otras actividades que te parezcan útiles.\r\n','physical','Salud Fisica'),(16,'rojoamarillo','Tu bienestar físico desmejoró con respecto a tu última medición. You have poor physical health and it is affecting your ability to engage in day-to-day activities. Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar físico, así que no te desanimes! If you haven’t visited the doctor recently, consider help from a medical doctor or other medical professionals. If you are working with a doctor, talk with him or her about strategies for managing pain and helping you to be effective. Mild exercise, healthy eating, and adequate sleep can help support you.\r\n','physical','Salud Fisica'),(17,'rojoverde','Tu bienestar físico desmejoró muy significativamente con respecto a tu última medición. \r\nTienes una salud física deficiente y estás afectando tu capacidad para participar en actividades cotidianas.Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar físico, así que no te desanimes! Si no has visitado al médico recientemente, considera la ayuda de un médico u otros profesionales médicos. Si estás trabajando con un médico, habla con él o ella sobre las estrategias para controlar el dolor y ayudarlo a ser eficaz. El ejercicio moderado, una alimentación saludable y un sueño adecuado pueden ayudarte.\r\n','physical','Salud Fisica'),(18,'verdeverde','Continúas manteniendo un alto nivel de bienestar físico. Tienes una excelente salud física y puedes realizar sus actividades cotidianas.\r\nProbablemente sientes más energía, y tienes un mejor estado físico. Felicitaciones, continuas teniendo niveles óptimos de bienestar físico! Te invitamos a que continues haciendo actividades que contribuyen a un estado físico óptimo a través del ejercicio regular moderado, alimentación saludable, sueño adecuado y otras actividades que te parezcan útiles.\r\n\r\n','physical','Salud Fisica'),(19,'amarilloamarillo','Desde la última evaluación, continúas manteniendo un nivel moderado de bienestar físco. Por lo general, tienes una buena salud física, aunque es posible que tenga problemas de dolor o de salud que a veces pueden interferir con tus actividades cotidianas en el trabajo o en actividades sociales.\r\n Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar físico, así que no te desanimes! Aprovecha esta oportunidad para explorar tu salud física y recuerda que es esta el cimiento para una buena salud mental. Verifica con tu médico las estrategias para controlar el dolor y apoyar la función diaria podría ser útil. Apoya tu salud física a través del ejercicio regular moderado, la alimentación saludable, el sueño adecuado y otras actividades que le parezcan útiles.\r\n\r\n\r\n','physical','Salud Fisica'),(20,'rojorojo','Desde la última evaluación, tu bienestar físico permanece en el extremo inferior. Tienes una salud física deficiente y estás afectando tu capacidad para participar en actividades cotidianas.\r\n Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar físico, así que no te desanimes! Si no has visitado al médico recientemente, considera la ayuda de un médico u otros profesionales médicos. Si estás trabajando con un médico, habla con él o ella sobre las estrategias para controlar el dolor y ayudarlo a ser eficaz. El ejercicio moderado, una alimentación saludable y un sueño adecuado pueden ayudarlo.\r\n\r\n\r\n\r\n','physical','Salud Fisica'),(21,'verdeamarillo','Felicitaciones!!!  Tu bienestar emocional mejoró significativamente con respecto a tu última medición. En este punto, estás satisfecho con tu vida y experimentas sentimientos positivos regularmente. La investigación ha demostrado que los sentimientos positivos pueden promover la salud física, las buenas relaciones e incluso el éxito en el trabajo. Continúa participando en actividades que te ayuden a sentirte positivo (a) y satisfecho (a) con tu vida.','emotional','Bienestar Emocional'),(22,'amarillorojo','Felicitaciones!!!  Tu bienestar emocional mejoró significativamente con respecto a tu última medición. En este punto, en general, estás satisfecho con tu vida, aunque puedes experimentar una mezcla de emociones positivas y negativas en diferentes momentos. Dependiendo de lo que está sucediendo en tu vida,  la mezcla de emociones puede ser bastante saludable. Sigue buscando actividades que te den una sensación de satisfacción. Identifica cuándo experimentas emociones positivas versus negativas y sigue buscando maneras de pasar a experimentar una mayor cantidad de emociones positivas de forma regular.','emotional','Bienestar Emocional'),(23,'verderojo','Felicitaciones!!!  Tu bienestar emocional mejoró muy significativamente con respecto a tu última medición. En este punto, estás satisfecho con tu vida y experimentas sentimientos positivos regularmente. La investigación ha demostrado que los sentimientos positivos pueden promover la salud física, las buenas relaciones e incluso el éxito en el trabajo. Continúa participando en actividades que te ayuden a sentirte positivo (a) y satisfecho (a) con tu vida.','emotional','Bienestar Emocional'),(24,'amarilloverde','Desde tu última evaluación, tu bienestar emocional disminuyó en cierta medida.\r\n Estos cambios muchas veces reflejan variaciones en tus circunstancias de vida. Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar emocional, así que no te desanimes! En general, estás satisfecho(a) con tu vida, aunque experimentas una mezcla de emociones positivas y negativas. Aprovecha esta oportunidad para explorar las situaciones en las que experimentas emociones negativas, y desarrollar así estrategias concretas para traer más satisfacción y emociones positivas a tu vida. Intenta encontrar actividades que te den una sensación de satisfacción. Considera la frecuencia con la que experimentas emociones positivas frente a negativas, y busca formas de avanzar hacia experimentar una mayor cantidad de emociones positivas de manera regular.\r\n','emotional','Bienestar Emocional'),(25,'rojoamarillo','Desde tu última evaluación, tu bienestar emocional disminuyó hasta cierto punto. Estos cambios muchas veces reflejan variaciones en tus circunstancias de vida. En este punto, no estás satisfecho(a) con tu vida y experimentas bastantes emociones negativas. La investigación ha demostrado que la experiencia de emociones negativas frecuentes está ligada a resultados de vida más pobres. La investigación sobre psicología positiva ayuda a encontrar actividades que pueden ayudar a construir emociones positivas. También podría ser útil visitar a un consejero para abordar la falta de salud emocional.\r\n','emotional','Bienestar Emocional'),(26,'rojoverde','Desde tu última evaluación, tu bienestar emocional disminuyó considerablemente. Puede haber una variedad de razones para este declive. En este punto, no estás satisfecho(a) con tu vida y experimentas bastantes emociones negativas. La investigación ha demostrado que la experiencia de emociones negativas frecuentes está ligada a resultados de vida más pobres. Puede ser útil visitar a un consejero para abordar la falta de salud emocional. También considera contactar a otros para obtener ayuda.','emotional','Bienestar Emocional'),(27,'verdeverde','Continúas manteniendo un alto nivel de bienestar emocional. Estás satisfecho con tu vida y experimentas sentimientos positivos de forma regular. La investigación ha demostrado que los sentimientos positivos pueden promover la salud física, las buenas relaciones e incluso el éxito en el trabajo. Continúa participando en actividades que te ayuden a sentirte positivo (a) y satisfecho (a) con tu vida.','emotional','Bienestar Emocional'),(28,'amarilloamarillo','Continúas manteniendo un nivel moderado de bienestar emocional. En general, estás satisfecho(a) con tu vida, aunque experimentas una mezcla de emociones positivas y negativas. Si bien conservas un nivel medio de bienestar emocional te invitamos a explorar estrategias para mejorarlo, adquiriendo mayor conciencia de las situaciones y eventos en los que experimentas emociones positivas y negativas y así diseñar estrategias para aumentar tu satisfacción con la vida y experimentar más emociones positivas como el amor, la alegría y la bondad.','emotional','Bienestar Emocional'),(29,'rojorojo','Desde la última evaluación, tu bienestar emocional permanece en el extremo inferior. No estás satisfecho(a) con tu vida y experimentas bastantes emociones negativas. La investigación ha demostrado que la experiencia de emociones negativas frecuentes está ligada a resultados de vida más pobres. Te invitamos a explorar estrategias para mejorarlo, adquiriendo mayor conciencia de las situaciones y eventos en los que experimentas emociones positivas y negativas y así diseñar estrategias para aumentar tu satisfacción con la vida y experimentar más emociones positivas como el amor, la alegría y la bondad. Si te sientes muy insatisfecho con tu vida te sugerimos acercarte al departamento de bienestar institucional y obtener asesoría personalizada por parte de nuestro equipo de psicólogos. Recuerda que estamos aquí para apoyarte. ','emotional','Bienestar Emocional'),(30,'verdeamarillo','Felicitaciones!!!  Tu bienestar financiero mejoró con respecto a tu última medición.\r\nTe sientes bien con tu situación financiera y tienes poca o ninguna deuda. Te recordamos que ser capaz de suplir las necesidades es un cimiento importante para construir el bienestar. ','financial','Bienestar Financiero'),(31,'amarillorojo','Felicitaciones!!!  Tu bienestar financiero mejoró significativamente con respecto a tu última medición.\r\nPuedes tener algunas preocupaciones sobre tu situación financiera o algún nivel de deuda, pero has progresado bien desde el punto en que estabas el año pasado. Te recordamos que ser capaz de suplir las necesidades en un cimiento importante para construir el bienestar','financial','Bienestar Financiero'),(32,'verderojo','Felicitaciones!!!  Tu bienestar financiero mejoró muy significativamente con respecto a tu última medición. te sientes bien con tu situación financiera y tienes poca o ninguna deuda.\r\nTe recordamos que ser capaz de suplir las necesidades es un cimiento importante para construir el bienestar.\r\n','financial','Bienestar Financiero'),(33,'amarilloverde','Tu bienestar financiero desmejoró con respecto a tu última medición. Tienes algunas preocupaciones sobre tu situación financiera o algún nivel de deuda. Estos cambios muchas veces reflejan variaciones en tus circunstancias de vida. Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar financiero, así que no te desanimes! Aprovecha esta oportunidad para explorar las el manejo que le das a tus finanzas y desarrollar así estrategias concretas para mejorar. Recuerda que ser capaz de suplir las necesidades económicas es un cimiento importante para construir el bienestar. ','financial','Bienestar Financiero'),(34,'rojoamarillo','Tu bienestar financiero desmejoró con respecto a tu última medición.\r\nTú estás preocupado(a) por tu situación financiera y podrías estar luchando con la deuda. Estos cambios muchas veces reflejan variaciones en tus circunstancias de vida. Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar financiero, así que no te desanimes! Aprovecha esta oportunidad para explorar el manejo que le das a tus finanzas y desarrollar así estrategias concretas para mejorar. Recuerda que ser capaz de suplir las necesidades económicas es un cimiento importante para construir el bienestar.','financial','Bienestar Financiero'),(35,'rojoverde','Tu bienestar financiero desmejoró muy significativamente con respecto a tu última medición. \r\nTe preocupa tu situación financiera y podrías estar luchando con la deuda.\r\nEstos cambios muchas veces reflejan variaciones en tus circunstancias de vida. Sin embargo, conocer este cambio es el primer paso para mejorar tu bienestar financiero, así que no te desanimes! Aprovecha esta oportunidad para explorar las el manejo que le das a tus finanzas y desarrollar así estrategias concretas para mejorar. Recuerda que ser capaz de suplir las necesidades económicas es un cimiento importante para construir el bienestar. También considera hablar con un asesor financiero que pueda ayudarte a mejorar tu situación financiera.','financial','Bienestar Financiero'),(36,'verdeverde','Continúas manteniendo un alto nivel de bienestar financiero. Te sientes bien con tu situación financiera y tienes poca o ninguna deuda. Usa lo que tienes actualmente para construir recursos para el futuro a través de inversiones y ahorros.','financial','Bienestar Financiero'),(37,'amarilloamarillo','Continúas manteniendo un nivel moderado de bienestar financiero. Puedes tener algunas preocupaciones sobre tu situación financiera o algún nivel de deuda.\r\nSi bien conservas un nivel medio de bienestar financiero te invitamos a explorar estrategias para mejorarlo, y adquirir mayor conciencia del manejo que le das al dinero para así diseñar estrategias concretas para mejorarlo. Considera hacer un seguimiento de tus gastos y asegurarte de que sólo gastas el dinero que tienes. Si no lo has hecho, también considera consultar a un asesor financiero que te puede proporcionar formas de consolidar parte de tu deuda y mejorar tu situación financiera.','financial','Bienestar Financiero'),(38,'rojorojo','Desde la última evaluación, tu bienestar financiero permanece en el extremo inferior. Te preocupa tu situación financiera y podrías estar luchando con la deuda. Te invitamos a explorar estrategias para mejorarlo, y adquirir así mayor conciencia del manejo que le das al dinero, lo cual te permitirá diseñar estrategias concretas para mejorarlo. Considera hacer un seguimiento de tus gastos y asegurarte de que solo gastas el dinero que tienes, centrándote en pagar tu deuda, y consultar a un asesor financiero para ayudarte a mejorar tu situación financiera.','financial','Bienestar Financiero'),(39,'verdeamarillo','Felicitaciones!!!  Tu dimensión de significado y propósito mejoró con respecto a tu última medición. Esto significa que tienes una mejor alineación con tus valores mas intimos, que has desarrollado un entendimiento más profundo del sentido de tu vida, has adquirido más sentido de dirección, tienes mayor claridad sobre tus metas y/o te sientes más conectado con el mundo.   Te invitamos a que continues en la senda del crecimiento personal, construyendo metas que aportan sentido a tu vida. Continúa realizando actividades que respalden tu propósito y busquen inspirar a otros a través de tu vida y acciones.','sentido_significado_proposito','Significado y Propósito'),(40,'amarillorojo','Felicitaciones!!!  Tu dimensión de significado y propósito mejoró con respecto a tu última medición. Tienes un sentido de significado, propósito y dirección en tu vida, aunque también puedes estar preguntándote en qué medida tus objetivos de vida son realmente significativos.  Te invitamos a que continues en la senda del crecimiento personal, construyendo metas que aportan sentido a tu vida. Es bastante común que las personas estén pensando en su propósito. Puede ser útil pensar qué actividades te dan más alegría y hacerte sentir vivo, y encontrar formas de seguir estas áreas. También es posible que desees considerar formas en que puedes contribuir a las vidas de los demás.','sentido_significado_proposito','Significado y Propósito'),(41,'verderojo','Felicitaciones!!!  Tu dimensión de significado y propósito mejoró muy significativamente con respecto a tu última medición. Esto significa que tienes una mejor alineación con tus valores mas intimos, que has desarrollado un entendimiento más profundo del sentido de tu vida, has adquirido más sentido de dirección, tienes mayor claridad sobre tus metas y/o te sientes más conectado con el mundo.   Te invitamos a que continues en la senda del crecimiento personal, construyendo metas que aportan sentido a tu vida. Continúa realizando actividades que respalden tu propósito y busquen inspirar a otros a través de tu vida y acciones.','sentido_significado_proposito','Significado y Propósito'),(42,'amarilloverde','Tu dimensión de significado y propósito desmejoró con respecto a tu última medición.  Tienes un sentido de significado, propósito y dirección en tu vida, aunque también puedes estar preguntando en qué medida tus objetivos de vida son realmente significativos.  Sin embargo, conocer este cambio es el primer paso para mejorar tu significado y propósito, así que no te desanimes! Aprovecha esta oportunidad para explorar tus valores, tu lugar en el mundo, y construir metas que aporten sentido a tu vida.   Es bastante común que las personas estén pensando en su propósito. Puede ser útil pensar qué actividades te dan más alegría y te hacen sentir vivo, y encontrar formas de seguir estas áreas. También es posible que desees considerar formas en que puedes contribuir a las vidas de los demás.','sentido_significado_proposito','Significado y Propósito'),(43,'rojoamarillo','Tu dimensión de significado y propósito desmejoró con respecto a tu última medición.No tienes un fuerte sentido de tu propósito y significado en la vida, y estás luchando por encontrar la dirección correcta para tu vida.  Sin embargo, conocer este cambio es el primer paso para mejorar tu significado y propósito, así que no te desanimes! Aprovecha esta oportunidad para explorar tus valores, tu lugar en el mundo, y construir metas que aporten sentido a tu vida.  Puede ser útil pensar qué actividades te dan más alegría y te hacen sentir vivo, y encontrar formas de seguir estas áreas. También puedes contribuir con formas en que puedas aportar a las vida de los demás. Si te encuentras sintiendo que la vida no tiene sentido, habla con un consejero o amigo de confianza y/o acercate al departamento de bienestar institucional y solicita hablar con uno de nuestros psicólogos. Recuerda que estamos aquí para apoyarte.','sentido_significado_proposito','Significado y Propósito'),(44,'rojoverde','Tu dimensión de significado y propósito desmejoró muy significativamente con respecto a tu última medición. No tienes un fuerte sentido de su propósito y significado, y estás luchando por encontrar la dirección correcta para tu vida.  Sin embargo, conocer este cambio es el primer paso para mejorar tu significado y propósito, así que no te desanimes! Aprovecha esta oportunidad para explorar tus valores, tu lugar en el mundo, y construir metas que aporten sentido a tu vida.   Puede ser útil pensar qué actividades te dan más alegría y te hacen sentir vivo, y encontrar formas de seguir estas áreas. También puedes contribuir con formas en que puedas aportar a las vida de los demás. Si te encuentras sintiendo que la vida no tiene sentido, habla con un consejero o amigo de confianza y/o acercate al departamento de bienestar institucional y solicita hablar con uno de nuestros psicólogos. Recuerda que estamos aquí para apoyarte.','sentido_significado_proposito','Significado y Propósito'),(45,'verdeverde',' Felicitaciones!!! Continúas manteniendo un alto sentido de significado y propósito. Tienes una sensación de significado, propósito y dirección en tu vida. Contribuyes a los demás y encuentras sentido en lo que haces.   Continúa realizando actividades que respalden tu propósito y busquen inspirar a otros a través de tu vida y acciones.','sentido_significado_proposito','Significado y Propósito'),(46,'amarilloamarillo','Desde la última evaluación, continúas manteniendo un sentido moderado de importancia. Tienes un sentido de significado, propósito y dirección en tu vida, aunque también puedes estarte preguntando en qué medida tus objetivos de vida son realmente significativos.  Si bien conservas un nivel medio de significado y propósito te invitamos a aprovechar esta oportunidad para explorar tus valores, tu lugar en el mundo, y construir metas que aporten sentido a tu vida.  Puede ser útil pensar qué actividades te dan más alegría y te hacen sentir vivo, y encontrar formas de seguir estas áreas. También es posible que desees considerar formas en que puedes contribuir a la vida de los demás.','sentido_significado_proposito','Significado y Propósito'),(47,'rojorojo','Desde la última evaluación, tu sentido de significado y propósito permanece en el extremo inferior. No tienes un fuerte sentido de tu propósito y significado, y puedes estar luchando para encontrar la dirección correcta para tu vida.   Sin embargo, adquirir conciencia de este aspecto es el primer paso para mejorar tus niveles de significado y propósito, así que no te desanimes! aprovecha esta oportunidad para explorar tus valores, tu lugar en el mundo, y construir metas que aporten sentido a tu vida.  Puede ser útil pensar qué actividades te dan más alegría y te hacen sentir vivo, y encontrar formas de seguir estas áreas. También puedes contribuir con formas en que puedas aportar  a la vida de los demás. Si te encuentras sintiendo que la vida no tiene sentido, habla con un consejero o amigo de confianza y/o acercate al departamento 